def scramble(string, int): 
  result = '' 
  for char in string: 
    if char.isalpha(): 
      num = ord(char) + int 
      if num > ord('z'): 
        num -= 26 
      elif num < ord('a'): 
        num += 26 
      result += chr(num) 
    else: 
      result += char 
  return result

